import React from 'react'
import Logo from '../images/logo192.png'

const Navbar = () => {
  return (
    // <div className='nav'>Navbar goes here</div>
    <header>
        <nav className='navBar'>
            <div className='logobox'> 
            <img src={Logo}  className='logo-pic' alt='React logo picture'/>
            <h3></h3>

            </div>
        </nav>

    </header>
  )
}

export default Navbar
